import React from 'react';
import './App.css';
import { Charts } from './Charts';
function App() {
  const content = (
    <header className="App-header">
      <form>
        <label>
          Name:
          <input type="text" name="name" />
        </label>
        <input type="submit" value="Submit" />
      </form>
      {/* < Charts /> */}
    </header>
  )
  return (
    <div className="App">
      {content}
    </div>
  );
}

export default App;
